define({
    inputs: {
    },
    outputs: {
        Speed: "number",
        Direction: "number",
        EngineStatus: "boolean"
    },
    setup: function(inputs, outputs) {
        this.targetSpeed = 0;
        this.targetDirection = 0;
        this.engineStatus = 'On';

        // Simulate driving
        this.simulateDriving = (function() {

            if(this.engineStatus === 'On') {
                if(Math.random() > 0.90) // 10% chance of turning engine off
                    this.engineStatus = 'Off';

                if(Math.random() > 0.60) // 30% chance of turning
                    this.targetDirection += Math.random() * 90 - 45;

                if(Math.random() > 0.60) {// 40% chance of changing speed
                    this.targetSpeed = 30 + Math.random() * 20;
                }
            }
            else {
                this.targetSpeed = 0;

                if(Math.random() > 0.8) // 20% chance of turning engine back on
                    this.engineStatus = 'On';
            }     

            this.runNextFrame();
            setTimeout(this.simulateDriving,1000);
        }).bind(this);
        this.simulateDriving();

        // Start values
        outputs.Speed = this.targetSpeed;
        outputs.Direction = this.targetDirection;
        outputs.EngineStatus = this.engineStatus;        
    },
    run: function(inputs, outputs) {
        // Slowly move towards targets
        outputs.Speed = this.targetSpeed;
        outputs.Direction = this.targetDirection;
        outputs.EngineStatus = this.engineStatus;
    }
});
